import Modal from "../MyModal/index";

export default class AddBill extends Component {

    render() {
        return (
            <Modal show={this.state.show} handleClose={this.props.handleClose} handleSave={this.props.handleSave}>
            <p>Modal</p>
          </Modal>
        )
    }
}
